21}},lore="During the Third War, the wizards of the Kirin Tor battled against the undead armies of the Scourge. When the wizards of Dalaran died in battle, they would rise soon after - adding their former might to the growing Scourge. Frustrated by their lack of progress (and against the advice of his peers) the Archmage, Arugal elected to summon extra-dimensional entities to bolster Dalaran's diminishing ranks. Arugal's summoning brought the ravenous worgen into the world of Azeroth. The feral wolf-men slaughtered not only the Scourge, but quickly turned on the wizards themselves. The worgen sieged the keep of the noble, Baron Silverlaine. Situated above the tiny hamlet of Pyrewood, the keep quickly fell into shadow and ruin. Driven mad with guilt, Arugal adopted the worgen as his children and retreated to the newly dubbed 'Shadowfang Keep'. It's said he still resides there, protected by his massive pet, Fenrus - and haunted by the vengeful ghost of Baron Silverlaine.",lvl=14,mapID=310,maps={311,312,313,314,315,316}},{n(-17,{q(1014,g({coords={{44.2,39.8,1421}},lvl=18,qgs={1938},r=1,rwp=40003},{qo(1,{providers={{"i",5442}}}),i(6414,{b=1,f=52,rwp=40003})})),q(1098,g({coords={a[123]},lvl=18,qgs=a[75],r=1,rwp=40003},{i(3324,{b=1,f=4,rwp=40003})})),q(1013,g({coords={{54,54.6,1458}},lvl=16,qgs={2934},r=1,rwp=40003},{qo(1,{providers={{"i",6283}}}),i(4534,{b=1,f=6,rwp=40003}),i(6335,{b=1,f=5,rwp=40003})})),q(1740,g({c=a[187],coords={{49.2,57.2,1413}},lvl=20,maps={221},qgs={6247},rwp=40003},{qo(1,{providers={{"i",6914}}}),qo(2,{providers={{"i",6915}}}),i(6898,{b=1,c=a[187],f=1,rwp=40003}),i(15109,{b=1,c=a[187],f=28,rwp=40003})}))}),n(0,{i(1935,{b=2,f=20,lvl=19}),i(3194,{b=2,f=24,lvl=16}),i(2205,{b=2,crs={2529,3857,3859,3863,3873,3877},f=26,lvl=20}),i(1483,{b=2,f=23,lvl=16}),i(1489,{b=2,crs={2529,3859,3863,3866,3873,3877},f=5,lvl=20}),i(2807,{b=2,f=21,lvl=18}),i(6915,{b=4,c=a[187],crs={3855}}),i(1974,{b=2,f=4,lvl=17}),i(2292,{b=2,crs={2529,3859,3863,3873,3877},f=4,lvl=20}),i