the hearths of the inns and shops, and much dwarven laughing and frivolity is to be heard. Also, unlike Stormwind and Darnassus, the city is actually a massive cavern carved into the earth by the dwarves; the ceiling and floor are both hard stone.\n\nMainly because of the Deeprun Tram, linking Ironforge and Stormwind City, and the district of Tinker Town, Ironforge is one of the most racially diverse cities in the Alliance world. Dwarves predominate, of course, but you will find plenty of gnomes even outside of Tinker Town, and probably as many humans. You will find almost no night elves however, as they probably prefer more natural and open spaced environments."},{n(-4,{}),n(-8,{faction(54,{icon="Interface\\Addons\\ATT-Classic\\assets\\Achievement_Character_Gnome_Male",OnTooltip=function(t)	local reputation = t.reputation;	if reputation < 42000 then	local isHuman = _.RaceIndex == 1;	local repPerTurnIn = isHuman and 82.5 or 75;	local x, n = math.ceil((42000 - reputation) / repPerTurnIn), math.ceil(42000 / repPerTurnIn);	GameTooltip:AddDoubleLine("Runecloth Turn Ins", (n - x) .. " / " .. n .. " (" .. x .. ")", 1, 1, 1);	end	end,r=2}),faction(47,{icon="Interface\\Addons\\ATT-Classic\\assets\\Achievement_Character_Dwarf_Male",OnTooltip=function(t)	local reputation = t.reputation;	if reputation < 42000 then	local isHuman = _.RaceIndex == 1;	local repPerTurnIn = isHuman and 82.5 or 75;	local x, n = math.ceil((42000 - reputation) / repPerTurnIn), math.ceil(42000 / repPerTurnIn);	GameTooltip:AddDoubleLine("Runecloth Turn Ins", (n - x) .. " / " .. n .. " (" .. x .. ")", 1, 1, 1);	end	end,r=2})}),n(-6,{fp(6,{coords={{55.6,48,1455}},crs={1573},r=2})}),n(-38,{prof(164,{n(4258,{coords={{52.6,40.8,1455}},r=2}),n(5164,g({coords={{50.2,42.6,1455}},r=2},{r(9788,{collectible=false,rwp=40003}),r(9974,{rwp=40003}),r(9954,{rwp=40003})})),n(11146,g({coords={{50.8,43,1455}},r=2},{r(9787,{collectible=false,rwp=40003}),r(17041,{collectible=false,rwp=40003}),r(17039,{collectible=false,rwp=4