ces of Ragnaros and his Dark Iron servants on one side and the black dragon Nefarian and his orc minions on the other. This is one of the most important areas in World of Warcraft lore.",lvl=40,maps={34,35}},{n(-16,{n(9026,g({coords={{36.2,36.2,35},{40.6,37.8,35},{37,28.2,35}}},{r(18422,{b=1,itemID=14486,requireSkill=197})})),n(9046,g({description="This mob used to simply be rare and have a limited loot table. He was later repurposed for use with the BWL Attunement Quest Chain. The two items listed below were never available in WoW Classic."},{i(13254,{b=1,f=8,lvl=51,u=2}),i(13248,{b=1,f=31,lvl=51,u=2}),i(18987,{b=1,lvl=55,rwp=40003})})),n(8924,g({coords={{37.8,61.3,35},{47.6,62,35}}},{i(19259,{spellID=23678,u=13}),i(11603,{b=2,f=34,lvl=46})}))})})),m(1419,g({lore="The Blasted Lands bear that name for a reason: they were twisted by the magic that brought the Dark Portal into being, spewing the rampaging Horde into Azeroth.\n\nThis wasted desert of red clay is home to the original Dark Portal. The portal still stands, and leads to Outland ? the remains of the orcs' sundered homeworld, Draenor. Nethergarde Keep, a Stormwind fortress of dour mages and paladins, keeps watch over the portal and the demons and ogres that would abuse its power.\n\nNow, the wretched land hosts few inhabitants and no significant settlements. Magic that leaked through the Dark Portal warped the Blasted Lands, leaving an infertile desert landscape. Hardy desert species like Basilisks, Scorpions and Hyenas have since colonized the area. The red rocks of the region do not come by their color naturally. The original tan color was transmuted into the unearthly crimson by searing heat and chaotic energies when the Dark Portal was destroyed."},{n(-4,{ach(766,{description="Explore Blasted Lands, revealing the covered areas of the world map.",OnClick=_.CommonAchievementHandlers.EXPLORATION_OnClick,OnUpdate=_.CommonAchievementHandlers.EXPLORATION_OnUpdate})}),n(-15,{exp(1441,{maphash="185:155:310:133"}