 landscape, as well as charred earth and burning ruins. The sky is a red hue here, due to sporadic eruptions from Blackrock Mountain. Blackrock Spire, an orc stronghold in the Second War, stands proud and defiant among the mountains. Dark Iron dwarves control the fortress's deeps, though rumor has it that Ragnaros the Fire Lord still broods in the shadows. Black dragons under Nefarion hold the spire's upper levels, and the two groups battle constantly for supremacy. The surrounding countryside is home to Blackrock orcs and Fire-Gut ogres, all brutal castoffs from the Second War. The Molten Span, a massive stone edifice in the north, bridges a river of fire and leads to Khaz Modan."},{n(-4,{ach(775,{description="Explore Burning Steppes, revealing the covered areas of the world map.",OnClick=_.CommonAchievementHandlers.EXPLORATION_OnClick,OnUpdate=_.CommonAchievementHandlers.EXPLORATION_OnUpdate})}),n(-15,{exp(255,{maphash="225:220:36:109"}),exp(254,{maphash="256:280:173:101"}),exp(2417,{maphash="270:310:589:279"}),exp(252,{maphash="245:265:334:114"}),exp(2421,{maphash="415:315:56:258"}),exp(249,{maphash="220:225:707:168"}),exp(2418,{maphash="294:270:708:311"}),exp(250,{maphash="270:285:513:99"}),exp(2420,{maphash="280:355:722:46"}),exp(253,{maphash="320:270:377:285"})}),n(-6,{fp(70,{coords={{65.6,24.2,1428}},crs={13177},r=1}),fp(71,{coords={{84.4,68.2,1428}},crs={2299},r=2})}),n(-17,{q(7630,{c=a[187],coords={{12.4,31.6,1428}},cost={{"i",12360,1}},lvl=60,qgs={14437},rwp=40003,sourceQuests={7626,7627,7628}}),q(7626,{c=a[187],coords={{12.6,31.6,1428}},cost={{"i",9264,2}},lvl=60,qgs={14436},rwp=40003,sourceQuests={7564}}),q(4726,g({coords={{65.2,23.8,1428}},lvl=50,qgs={10267},rwp=40003},{qo(1,{cost={{"i",12284,1}},crs={7047,7049},providers={{"i",12283}}})})),q(7628,{c=a[187],coords={{12.6,31.6,1428}},cost={{"i",15416,3}},lvl=60,qgs={14436},rwp=40003,sourceQuests={7564}}),q(3823,g({coords={{84.6,68.8,1428}},lvl=48,qgs={9177},r=2,rwp=40003},{qo(1,{providers={{"n",7034}}}),