."},{n(-4,{ach(774,{description="Explore Searing Gorge, revealing the covered areas of the world map.",OnClick=_.CommonAchievementHandlers.EXPLORATION_OnClick,OnUpdate=_.CommonAchievementHandlers.EXPLORATION_OnUpdate})}),n(-15,{exp(1442,{maphash="405:430:85:30"}),exp(1957,{maphash="275:235:77:366"}),exp(246,{maphash="425:325:250:170"}),exp(1959,{maphash="460:365:422:8"}),exp(1444,{maphash="360:280:247:388"}),exp(247,{maphash="305:220:494:300"}),exp(1958,{maphash="305:230:545:407"})}),n(-6,{fp(74,{coords={{37.8,30.6,1427}},crs={2941},r=2}),fp(75,{coords={{34.8,30.6,1427}},crs={3305},r=1})}),n(-17,{q(4449,g({coords={{65.5,62.2,1427}},cost={{"i",4306,15}},lvl=43,providers={{"o",173265}},rwp=40003},{qo(1,{providers={{"n",5839}}})})),q(7723,g({coords={{38.6,27.8,1427}},lvl=45,qgs={14627},rwp=40003},{qo(1,{providers={{"n",5854}}}),i(19126,{b=1,f=7,rwp=40003})})),q(3441,{coords={{39.1,39,1427}},lvl=40,qgs={8479},rwp=40003}),q(3371,{coords={{71.4,16.2,1455}},lvl=40,qgs={8256},r=2,rwp=40003,sourceQuests={3368}}),q(5144,{altQuests={5141,5143},coords={{63.6,76,1427}},cost={{"i",7081,2},{"i",7075,2},{"i",7079,2},{"i",7077,2}},lvl=40,qgs={7868},r=2,requireSkill=165,rwp=40001}),q(7724,g({coords={{38.6,27.8,1427}},lvl=45,qgs={14627},rwp=40003},{qo(1,{providers={{"n",5858}}}),i(19125,{b=1,f=6,rwp=40003})})),q(3443,g({coords={{39.1,39,1427}},lvl=40,qgs={8479},rwp=40003,sourceQuests={3442}},{qo(1,{crs={5839,5840,5843,5844,5846,8337,8504,8566,8637,15692},providers={{"i",10551}}})})),q(7737,{coords={{38.8,28.5,1427}},cost={{"i",18945,4}},lvl=40,maxReputation=a[152],minReputation=a[151],qgs={14624},repeatable=1,sourceQuests={7722}}),q(7727,g({coords={{38.6,27.8,1427}},lvl=45,qgs={14627},rwp=40003},{qo(1,{providers={{"n",9318}}}),i(19141,{b=1,f=53,rwp=40003})})),q(7729,g({coords={{37.7,26.5,1427}},lvl=45,providers={{"o",179827}},rwp=40003},{qo(1,{providers={{"n",5846}}}),qo(2,{providers={{"n",5844}}})})),q(7702,g({awp=30300,coords={{38.4,27.7,1427}},lvl=30,qgs={14628},rwp=40003,u=1},{qo(