lent save for the occasional unnatural howling echoing among the trees. Mossy overhangs shiver in the cold breeze, and the trees are all sickly or dying. Dilapidated farmsteads and abandoned mines dot the land, home now to the darker denizens of the woods.\n\nThis woodland is haunted and wild, characterized by its tall, silver-barked pines towering over grassy knolls. The Alliance once protected Silverpine Forest when it was verdant and lively. Now the place is shrouded in ghostly mists. Forsaken control the northern forest. What remains of the human population retains control of the southern forest, but they are desperate and their forces thinly stretched. Dalaran sends frequent expeditions into Silverpine to defend these people and study the undead plague and worgen curse ? a mysterious affliction that causes its victims to transform into bloodthirsty, lycanthropic worgen when the moon rises."},{n(-4,{ach(769,{description="Explore Silverpine Forest, revealing the covered areas of the world map.",OnClick=_.CommonAchievementHandlers.EXPLORATION_OnClick,OnUpdate=_.CommonAchievementHandlers.EXPLORATION_OnUpdate})}),n(-15,{exp(928,{maphash="180:128:323:128"}),exp(204,{maphash="140:125:391:446"}),exp(226,{maphash="185:165:286:37"}),exp(213,{maphash="160:170:470:261"}),exp(230,{maphash="210:215:379:447"}),exp(927,{maphash="256:220:459:13"}),exp(238,{maphash="256:160:465:0"}),exp(240,{maphash="175:165:402:65"}),exp(233,{maphash="240:240:494:262"}),exp(172,{maphash="250:215:593:74"}),exp(236,{maphash="220:160:364:359"}),exp(229,{maphash="165:185:382:252"}),exp(231,{maphash="240:180:491:417"}),exp(237,{maphash="180:185:457:144"}),exp(228,{maphash="210:160:352:168"})}),n(-6,{fp(10,{coords={{45.6,42.6,1421}},crs={2226},r=1})}),n(-17,{q(530,g({coords={{62,43,1458}},lvl=10,qgs={2050},r=1,rwp=40003,sourceQuests={441}},{qo(1,{coords={{46.4,84.6,1421}},crs={2332},providers={{"i",3613}}}),i(3235,{b=1,f=52,rwp=40003})})),q(447,g({coords={a[123]},lvl=9,qgs={1937},r=1,rwp=40003},{qo(1