d Sorrow Hill. The Scarlet Crusade has a significant holding in and around Hearthglen to the north, and the Alliance has settled in the small Chillwind Camp to the south.\n\nLike their eastern counterparts, the Western Plaguelands were once fertile and beautiful but are now gray, blighted and noxious. Undead wander the land and haunt the abandoned towns and farmsteads. The largest Scourge city here is Andorhal, beneath which is an underground complex housing the undead's School of Necromancy. The Scarlet Crusade strikes against the Scourge from Hearthglen. The only place of any sanity in the Western Plaguelands is Uther's Tomb, a consecrated monument to the fallen hero Uther Lightbringer."},{n(-4,{ach(770,{description="Explore Western Plaguelands, revealing the covered areas of the world map.",OnClick=_.CommonAchievementHandlers.EXPLORATION_OnClick,OnUpdate=_.CommonAchievementHandlers.EXPLORATION_OnUpdate})}),n(-15,{exp(2298,{maphash="170:165:600:412"}),exp(199,{maphash="160:125:300:311"}),exp(197,{maphash="300:206:355:462"}),exp(2297,{maphash="370:270:504:343"}),exp(192,{maphash="220:180:382:164"}),exp(193,{maphash="285:230:260:355"}),exp(200,{maphash="220:150:381:265"}),exp(201,{maphash="180:205:520:250"}),exp(190,{maphash="340:288:307:16"}),exp(813,{maphash="225:185:137:293"}),exp(202,{maphash="170:190:451:323"}),exp(2620,{maphash="205:340:590:86"}),exp(198,{maphash="160:200:566:198"})}),n(-6,{fp(66,{coords={{42.8,85,1422}},crs={12596},r=2})}),n(-17,{q(5066,{coords={{54.8,62.6,1453}},isBreadcrumb=1,lvl=50,nextQuests={5092},qgs={2198},r=2,rwp=40003}),q(5090,{coords={{31.6,67,1455}},isBreadcrumb=1,lvl=50,nextQuests={5092},qgs={10877},r=2,rwp=40003}),q(5091,{coords={{36.4,39.8,1457}},isBreadcrumb=1,lvl=50,nextQuests={5092},qgs={10878},r=2,rwp=40003}),q(10373,{coords={{55.4,47.2,1947}},isBreadcrumb=1,lvl=50,nextQuests={5092},qgs={20722},r=2,rwp=40003}),q(5093,{coords={{46.6,64.6,1454}},isBreadcrumb=1,lvl=50,nextQuests={5096},qgs={10880},r=1,rwp=40003}),q(5094,{coords